import React from "react";
import Question from "./Question";

const QuestionTable = ({ questions }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Question ID</th>
          <th>Title</th>
          <th>Description</th>
          <th>Category</th>
          <th>Complexity</th>
        </tr>
      </thead>
      <tbody>
        {questions.map((question) => (
          <Question key={question.id} question={question} />
        ))}
      </tbody>
    </table>
  );
};

export default QuestionTable;
